反轉: 程序本身不創建對象，而變成被動的接收對象
依賴注入: 就是利用 set 方法來進行注入的。


IOC是一種編程思想，由主動的編程變成被動的接收。可以通過 newClassPathXmlApplicationContext 去瀏覽一下底層源碼。
